import React, { useState, useEffect } from 'react'
import { Dropdown, Grid } from 'semantic-ui-react'
import axios from 'axios'

export default function AutocompletEtablissement({ informations, informationsRH, handleChange, disable }) {

    const [data, setData] = useState([])

    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.get(
                'http://localhost:3000/etablissementData',
            );
            setData(result.data);
        };
        fetchData();
    }, []);

    return (
        <Grid>
            <div className='autoCompletTitre'>Etablissement digital</div>
            <Dropdown
                onChange={handleChange}
                placeholder='Etablissement digital'
                fluid
                search
                name='etablissement'
                disabled={disable}
                selection
                value={informations.etablissement || informationsRH.etablissement}
                options={data}
            />
        </Grid>

    )


}
